import axios from "axios";

const UserAPI = {

     signUp : (user)=>{
        axios({
            url: "http://127.0.0.1:5000/api/user/create",
            method : "POST",
            data: user
        }).then(response => {
            console.log(response.data.message)
        }).catch(err => {
            console.log(err)
        })
    },
    userLogin: (user)=>{
        let success = null;
        axios({
            url: "http://127.0.0.1:5000/api/user/login",
            method : "POST",
            data: user
        }).then(response => {
            console.log(response.data.success,"api")
            console.log(response.data.id)
            success = response.data.success
        }).catch(err => {
            console.log(err)
        })
        return success
    }
}

export default UserAPI;
